import './App.css';
import { Routes, Route, useLocation } from "react-router-dom";
import Home from './pages/Home/Home';
import Round1 from './pages/User/Round1';

function App() {
  return (
    <>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/Round1" element={<Round1 />} />
      </Routes>
    </>
  );
}

export default App;
